class BinaryTree {
    constructor(val) {
        this.val = val;
        this.left = null;
        this.right = null;
    }

    insertLeft(val) {
        this.left = val;
    }

    insertRight(val) {
        this.right = val;
    }
}

const getParent = function(root, n, parent) {
    if (!root) return null;
    if (root.val === n) return parent;
    // return and chain with logical OR
    return getParent(root.left, n, root) || getParent(root.right, n, root);
}


